	this.getAvailableUnits = function()
	{
		return [ConstructionRigUnit, FreighterUnit, GuardianUnit, BionUnit, ExterminatorUnit];
	};
	
	this.getAvailableBuildings = function()
	{
		return [//Main buildings
			HeadquarterBuilding, WaterLaunchPadBuilding, TaelonPowerBuilding, 
			TrainingFacilityBuilding, AssemblyPlantBuilding, PlasmaTurretBuilding,
			NeutronAcceleratorBuilding, AirDefenceSiteBuilding, CameraTowerBuilding, 
			FieldHospitalBuilding, RepairStationBuilding, TemporalGateBuilding,
			RearmingDeckBuilding, RiftCreatorBuilding, HorizontalBridgeBuilding, 
			VerticalBridgeBuilding, 
			//Upgrades
			Headquarter2Building, Headquarter3Building, 
			TrainingFacility2Building, AssemblyPlant2Building,
			//Civilian buildings
			WaterWellBuilding, TaelonMineBuilding, CivilianVerticalBridge
		];
	};
	
	this.generateMap = function()
	{
		var $canvas = $('#map_view'), ctx = $canvas.get(0).getContext('2d'), tiles = game.resources.get('map-tiles');
		
		$canvas.attr({
			width: CELL_SIZE*this.size.x,
			height: CELL_SIZE*this.size.y
		});
		
		//Tiles
		for (var x=0; x<this.size.x; ++x)
			for (var y=0; y<this.size.y; ++y)
			{
				ctx.drawImage(
					tiles, (this.map_tiles[x][y]%32)*CELL_SIZE, Math.floor(this.map_tiles[x][y]/32)*CELL_SIZE, 
					CELL_SIZE, CELL_SIZE, x*CELL_SIZE, y*CELL_SIZE, CELL_SIZE, CELL_SIZE
				);
			}
			
		//Objects
		for (var i=0; i<this.map_objects.length; ++i)
		{
			var proto = this.map_object_proto[this.map_objects[i].key];
			
			ctx.drawImage(
				game.resources.get('mapobj_' + this.map_objects[i].key), 
				0, 0, proto.size.x, proto.size.y, 
				this.map_objects[i].x*CELL_SIZE - proto.center.x, this.map_objects[i].y*CELL_SIZE - proto.center.y, 
				proto.size.x, proto.size.y
			);
		}
	};
